import React, { Component } from 'react';

class Kids extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
           <div className="main-container">
           <h1>Kider Joy</h1>
           	<div className="stuff-container">
           		<div className="stuff" draggable="true">Dog</div>
           		<div className="stuff" draggable="true">Green</div>
           		<div className="stuff" draggable="true">Orange</div>
           		<div className="stuff" draggable="true">Eight</div>
           	</div>
           	<table>
           	  <tr>
           	  	<th>Animals</th>
           	  	<th>Fruits</th>
           	  	<th>Numbers</th>
           	  	<th>Colours</th>
           	  </tr>
           	</table>
           </div> 
        );
    }
}

export default Kids;
